import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Find a "Your Profile" link using text selector (first occurrence)
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    const profileLinks = await page.$$('a:has-text("Your Profile")');
    let profileLink = null;
    if (profileLinks.length > 0) {
      profileLink = profileLinks[0];
      // Scroll into view and click
      await profileLink.scrollIntoViewIfNeeded();
      await profileLink.click();
      // Take screenshot after click (even if SPA, for visual proof)
      const afterClickShot = path.join(screenshotsDir, 'step_2_profile_link_clicked.png');
      await page.screenshot({ path: afterClickShot });
      screenshots.push(afterClickShot);
    }

    // Wait for the profile section to appear (look for .profile-page or .profile-header)
    let profileHeader = null;
    try {
      await page.waitForSelector('.profile-header', { timeout: 5000 });
      profileHeader = await page.$('.profile-header');
    } catch (e) {
      // fallback: try .profile-page
      try {
        await page.waitForSelector('.profile-page', { timeout: 5000 });
        profileHeader = await page.$('.profile-page');
      } catch (e2) {
        profileHeader = null;
      }
    }

    // Take screenshot of profile section
    const profileShot = path.join(screenshotsDir, 'step_3_profile_section.png');
    await page.screenshot({ path: profileShot });
    screenshots.push(profileShot);

    // Extract profile info using multiple selector strategies
    let extractedData = {};
    if (profileHeader) {
      // Full name
      let fullName = await page.$eval('.profile-header h2', el => el.textContent.trim()).catch(() => null);
      // Username
      let username = await page.$eval('.profile-header .username', el => el.textContent.trim()).catch(() => null);
      // Bio
      let bio = await page.$eval('.profile-header .bio', el => el.textContent.trim()).catch(() => null);
      // Profile image
      let profileImage = await page.$eval('.profile-header img.profile-image', el => el.src).catch(() => null);

      // Stats (Orders, Reviews, Seller Rating) - using .stat-number and .stat-label
      let stats = {};
      const statEls = await page.$$('.profile-header .stat');
      for (const statEl of statEls) {
        const number = await statEl.$eval('.stat-number', el => el.textContent.trim()).catch(() => null);
        const label = await statEl.$eval('.stat-label', el => el.textContent.trim()).catch(() => null);
        if (label && number) stats[label] = number;
      }

      extractedData = {
        fullName,
        username,
        bio,
        profileImage,
        stats
      };
    }

    // Also extract Jun's recent reviews (from .reviews-list)
    let reviews = [];
    const reviewItems = await page.$$('.reviews-list .review-item');
    for (const reviewItem of reviewItems) {
      const productTitle = await reviewItem.$eval('.review-product-title', el => el.textContent.trim()).catch(() => null);
      const reviewTitle = await reviewItem.$eval('.review-title', el => el.textContent.replace(/"/g, '').trim()).catch(() => null);
      const reviewContent = await reviewItem.$eval('.review-content', el => el.textContent.trim()).catch(() => null);
      const reviewDate = await reviewItem.$eval('.review-date', el => el.textContent.trim()).catch(() => null);
      reviews.push({
        productTitle,
        reviewTitle,
        reviewContent,
        reviewDate
      });
    }
    extractedData.reviews = reviews;

    return {
      success: true,
      action: "Harvested user profile information including name, username, bio, stats, profile image, and recent reviews.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
